import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Userscreen from './Components/Userscreen';
import './App.css';
import UserHost from './Components/UserHost';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          <Userscreen />
        </Route>
        <Route path="/userscreen">
          <UserHost />
        </Route>
      </Switch>
    </Router>
  );
}




export default App;
